import React from "react";

import aurora1 from "../img/aurora1.png";
import aurora2 from "../img/aurora2.png";

class Portfolio extends React.Component {

  constructor() {
    super();
    this.state = {
      about_project: [
        {
          id: "first-p-about",
          content:
            "Founded a business specializing in the distribution of private residential and data center proxies"
        },
        {
          id: "second-p-about",
          content:
            "Worked in a fullstack MERN role developing a dashboard & checkout site with API calls to Stripe, Discord, and Oxylabs"
        },
        {
          id: "third-p-about",
          content:
          "MongoDB, ReactJS, Node, Express"
        },
        {

        }
      ]
    };
  }
  render() {
    return (
      <section id="work" className="portfolio-mf sect-pt4 route">
        <div className="container">
        <div className="row">
            <div className="col-sm-12">
              <div className="box-shadow-full">
                <div className="row">
                  <div className="about-me pt-4 pt-md-0">
                    <div className="title-box-2">
                      <a href="https://github.com/zactham/AuroraProxyDashboardNoKeys" target="_blank" rel="noreferrer noopener">
                        <h5 className="title-left">Aurora Proxies</h5>
                      </a>
                    </div>
                    <a href={aurora1} data-lightbox="gallery-aguadeluz">
                      <div className="work-img">
                        <img src={aurora1} alt="" className="img-fluid" />
                      </div>
                      <div className="work-content">
                        <div className="row">
                          <div className="col-sm-8">
                            <h2 className="w-title">Lorem Ipsum</h2>
                            <div className="w-more">
                              <span className="w-ctegory">
                                HTML5 CSS3 Bootstrap Webpack SmoothScrolling
                                VanillaJS
                              </span>{" "}
                            </div>
                          </div>
                          <div className="col-sm-4">
                            <div className="w-like">
                              <span className="ion-ios-plus-outline"></span>
                            </div>
                          </div>
                        </div>
                      </div>
                </a>
                    <a
                      href={aurora1}
                      data-lightbox="gallery-vmarine"
                      style={{ display: "none" }}
                    >
                      jsx-a11y/anchor-has-content warning
                    </a>
                    <a
                      href={aurora2}
                      data-lightbox="gallery-vmarine"
                      style={{ display: "none" }}
                    >
                      jsx-a11y/anchor-has-content warning
                    </a>
                    {this.state.about_project.map(content => {
                      return (
                        <p className="lead" key={content.id}>
                          {content.content}
                        </p>
                      );
                    })}
                  </div>

                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }
}

export default Portfolio;
